import { wineOne } from "../Data/wine_data.js";
import "./Layout//wineDisplay.css";

export default function wineDisplay() {
  return (
    <div class="wine">
      <img src="https://www.google.com/search?q=O%E2%80%99Shaughnessy+2018+Cabernet+Sauvignon+(Napa+Valley)&rlz=1C5CHFA_enUS950US950&source=lnms&tbm=isch&sa=X&ved=2ahUKEwiLyZ2ek573AhVBlWoFHUU4A-cQ_AUoAXoECAEQAw&biw=1440&bih=736&dpr=2#imgrc=BV2Vu81nMFts2M"
 alt="Deez Nuts" style="width:100%"></img>
      <h1>{wineOne.name}</h1>
      <p class="price">${wineOne.price}</p>
      <li>
        <ul>Type: {wineOne.type}</ul>
        <ul>Region: {wineOne.region}</ul>
      </li>
      <p>
        <button>More Information</button>
      </p>
    </div>
  );
}
